import React from "react";

import Card from "../UI/Card/Card";
import SideBar from "./SideBar";
import ProfileInfo from "./ProfileInfo";
import classes from "./Home.module.css";

const Home = (props) => {
  return (
    <Card className={classes.home}>
      <SideBar />
      <ProfileInfo />
    </Card>
  );
};

export default Home;
